description:
17, o varsta misto si la voia destinului!

&quot;Asa cred ca incepe orice poveste, intr-o zi pe care tu o consideri speciala. De aceea iti aduci aminte de ea si o numesti poveste. In momentul in care te uiti in jur, iti dai seama ca nimic nu este special. Oamenii isi traiesc momentul, iar orasul are acelasi ritm pe care il are in fiecare zi.
Cand te gandesti ca 18 e varsta la care devii major... cred ca 17 e probabil varsta la care dai mana cu destinul. Sau cum ar spune sotul mamei mele, 17 e varsta la care devii responsabil. Eu cred ca este varsta la care devii total liber. De aici poti face tot ce vrei!&quot;
